     4→function Card({title, children}:{title:string, children:any}) {
     5→  return (
     6→    <div className="p-6 border border-gray-200 rounded-xl mb-6 bg-white shadow-sm">
     7→      <h2 className="mt-0 text-xl font-semibold text-gray-900 border-b-2 border-gray-100 pb-2 mb-4">
     8→        {title}
     9→      </h2>
    10→      {children}
    11→    </div>
    12→  )
    13→}
    14→
    15→export default function App() {
    16→  const [providers, setProviders] = useState<any[]>([])
    17→  const [pools, setPools] = useState<any[]>([])
    18→  const [usage, setUsage] = useState<any|null>(null)
    19→  const [showAddProviderModal, setShowAddProviderModal] = useState(false)
    20→  const [formData, setFormData] = useState({
    21→    name: '',
    22→    type: 'api' as 'api' | 'file' | 'manual',
    23→    config: '{}',
    24→    logoUrl: ''
    25→  })
    26→  const [isSubmitting, setIsSubmitting] = useState(false)
    27→  const [notifications, setNotifications] = useState<any[]>([])
    28→  const [selectedNotificationMethod, setSelectedNotificationMethod] = useState<string>('')
    29→  const [showConfigModal, setShowConfigModal] = useState(false)
    30→  const [configFormData, setConfigFormData] = useState({ enabled: false, config: {}, eventTypes: [] as string[] })
    31→  const eventTypes = [
    32→    'provider-added',
    33→    'provider-updated',
    34→    'order-rotated',
    35→    'order-deleted',
    36→    'health-fail',
    37→    'usage-alert',
    38→    'import-complete',
    39→    'lease-failed'
    40→  ] as const
    41→  const [notificationConfigs, setNotificationConfigs] = useState<{ [key: string]: any }>({})
    42→
    43→  const [orders, setOrders] = useState<any[]>([])
    44→  const [selectedProvider, setSelectedProvider] = useState<string>('')
    45→  const [points, setPoints] = useState<any[]>([])
    46→  const [sampleMode, setSampleMode] = useState(true)
    47→
    48→  useEffect(()=>{
    49→    async function loadData() {
    50→      try {
    51→        const [provRes, poolsRes, usageRes] = await Promise.all([
    52→          fetch('http://localhost:8080/v1/providers').then(r => r.ok ? r.json() : Promise.reject(r)),
    53→          fetch('/v1/pools/stats').then(r => r.ok ? r.json() : Promise.reject(r)),
    54→          fetch('/v1/usage/summary').then(r => r.ok ? r.json() : Promise.reject(r))
    55→        ]);
    56→        setProviders(Array.isArray(provRes) ? provRes : provRes.items || []);
    57→        setPools(poolsRes);
    58→        setUsage(usageRes);
    59→      } catch (error) {
    60→        console.error('Failed to load data:', error);
    61→        // Set empty states gracefully
    62→        setProviders([]);
    63→        setPools([]);
    64→        setUsage(null);
    65→      }
    66→    }
    67→    loadData();
    68→    loadPoints(true);
    69→  },[])
    70→
    71→  async function loadPoints(sample:boolean) {
    72→    try {
    73→      setSampleMode(sample)
    74→      const url = sample ? '/v1/proxies/sample' : '/v1/proxies?limit=5000'
    75→      const r = await fetch(url)
    76→      if (!r.ok) {
    77→        throw new Error(`HTTP ${r.status}: ${r.statusText}`);
    78→      }
    79→      const data = await r.json()
    80→      setPoints((data.items || data || []).map((p:any)=>({
    81→        id: p.id,
    82→        latitude: p.latitude,
    83→        longitude: p.longitude,
    84→        host: p.host,
    85→        country: p.country,
    86→        city: p.city,
    87→        asn: p.asn,
    88→        org: p.org,
    89→        pool: p.pool
    90→      })))
    91→    } catch (error) {
    92→      console.error('Failed to load points:', error)
    93→      setPoints([])  // Graceful empty state
    94→    }
    95→  }
    96→
    97→  async function loadOrders(pid:string) {
    98→    setSelectedProvider(pid)
    99→    const r = await fetch(`/v1/providers/${pid}/orders/sync`, {method:'POST'})
   100→    const data = await r.json()
   101→    setOrders(data.orders || [])
   102→  }
   103→
   104→  async function rotateOrder(pid:string, oid:string) {
   105→    await fetch(`/v1/providers/${pid}/orders/${oid}/rotate`, {method:'POST'})
   106→    await loadOrders(pid)
   107→  }
   108→  async function deleteOrder(pid:string, oid:string) {
   109→    await fetch(`/v1/providers/${pid}/orders/${oid}/delete`, {method:'POST'})
   110→    await loadOrders(pid)
   111→  }
   112→
   113→  return (
