   115→      <h1 className="text-3xl font-bold text-gray-900 mb-8">ProxyHub Admin</h1>
   116→
   117→      <Card title="Proxy Map">
   118→        <div className="flex gap-2 mb-2">
   119→          <button onClick={()=>loadPoints(true)} disabled={sampleMode} className="px-4 py-2 bg-blue-500 text-white rounded disabled:opacity-50">Load Sample</button>
   120→          <button onClick={()=>loadPoints(false)} disabled={!sampleMode} className="px-4 py-2 bg-green-500 text-white rounded disabled:opacity-50">Load All (clustered)</button>
   121→        </div>
