   131→            <button
   132→              onClick={() => setShowAddProviderModal(true)}
   133→              className="px-4 py-2 bg-blue-500 text-white rounded-lg font-medium shadow-sm hover:bg-blue-600 transform hover:-translate-y-0.5 transition-all"
   134→            >
   135→              + Add Provider
   136→            </button>
   137→          </div>
