            } catch (error) {
              alert('Error sending test');
              console.error(error);
            }
          }}
          style={{
            padding: '8px 16px',
            backgroundColor: '#10b981',
            color: 'white',
            border: 'none',
            borderRadius: 8,
            cursor: 'pointer',
            fontWeight: 500
          }}
        >
          Send Test Notification
        </button>
      </Card>
    </div>
  )
}

