import React from 'react';

interface KPIProps {
  title: string;
  value: string | number;
  icon: React.ReactNode;
  trend?: string;
  color?: 'green' | 'red' | 'blue';
}

const DashboardKPI: React.FC<KPIProps> = ({ title, value, icon, trend, color = 'blue' }) => {
  const getColorClass = () => {
    switch (color) {
      case 'green': return 'text-green-600 bg-green-100';
      case 'red': return 'text-red-600 bg-red-100';
      default: return 'text-blue-600 bg-blue-100';
    }
  };

  const getTrendClass = () => trend?.includes('+') ? 'text-green-600' : 'text-red-600';

  return (
    <div className="kpi-card p-6 rounded-lg shadow-sm border border-gray-200 bg-white">
      <div className="flex items-center justify-between mb-2">
        <div className={`p-3 rounded-full ${getColorClass()}`}>{icon}</div>
        {trend && <span className={`font-medium ${getTrendClass()}`}>{trend}</span>}
      </div>
      <div className="text-sm font-medium text-gray-500 uppercase tracking-wide mb-1">{title}</div>
      <div className="text-3xl font-bold text-gray-900">{value}</div>
    </div>
  );
};

